import React from 'react';

import Sections from './Components/Sections';
import Main from './Components/Main';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Container>
        <Row>
          <Sections />
        </Row>
        <Row>
          <Main />
        </Row>
      </Container>
    );
  }
}

export default App;
